function client(endpoint, customConfig = {}) {
  const config = {
    method: "GET",
    ...customConfig,
  }

  return window
    .fetch(`${process.env.GENIUS_API_URL}/${endpoint}&${process.env.GENIUS_API_CLIENT_TOKEN}`, config)
    .then(response => {
      console.log(response)
    })
}

export {client}
